package Question.Q859_pass;

import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class Solution2Test {

    @Test
    public void buddyStrings1() {
        String A = "ab";
        String B = "ba";

        assertEquals(true, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings2() {
        String A = "ab";
        String B = "ab";

        assertEquals(false, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings3() {
        String A = "aaaaaaabc";
        String B = "aaaaaaacb";

        assertEquals(true, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings4() {
        String A = "";
        String B = "aa";

        assertEquals(false, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings5() {
        String A = "";
        String B = "";

        assertEquals(true, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings6() {
        String A = "aa";
        String B = "aa";

        assertEquals(true, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings7() {
        String A = "abcaa";
        String B = "abcbb";

        assertEquals(false, new Solution2().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings8() {
        String A = "abcd";
        String B = "badc";

        assertEquals(false, new Solution2().buddyStrings(A, B));
    }
}